INSERT INTO `airlines` (`id`, `name`, `slug`, `code`, `logo`, `img`, `content`, `routes`, `created_at`, `updated_at`) VALUES
(1, 'Air KBZ', 'air-kbz', 'K7', 'air-kbz.png', 'a:7:{i:0;s:19:\"5c5135e486366_1.jpg\";i:1;s:19:\"5c5135e4866aa_2.jpg\";i:2;s:19:\"5c5135e486958_3.jpg\";i:3;s:19:\"5c5135e487a67_4.jpg\";i:4;s:19:\"5c5135e487dbe_5.jpg\";i:5;s:19:\"5c5135e487fd4_6.jpg\";i:6;s:19:\"5c5135e48825e_7.jpg\";}', '<p></p><p class=\"MsoNormal\"><span style=\"font-family:\" calisto=\"\" mt\",\"serif\";mso-bidi-font-family:=\"\" arial;color:#333333\"=\"\">Air KBZ become the most renowned commercial airline in\r\nMyanmar</span>. To cater the demands of the industry by providing excellent\r\ncustomer service through safety, comfort, hospitality and enriching employees.\r\nUnder the guidance of Myanmar Investment Commission, Air Kanbawza, otherwise\r\nknown as AIR KBZ, was established in June 2010. The purpose of this\r\nestablishment is to help the fellow existing airlines cater the growing demands\r\nof air travel in Myanmar. Taking off her very first commercial flight on April\r\n2nd 2011, to this date AIR KBZ has unveiled 15 destinations altogether.<br style=\"font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;\r\ntext-align:start;widows: 2;-webkit-text-stroke-width: 0px;text-decoration-style: initial;\r\ntext-decoration-color: initial;word-spacing:0px\">\r\n<span style=\"font-variant-ligatures: normal;font-variant-caps: normal;\r\norphans: 2;text-align:start;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;float:none;\r\nword-spacing:0px\">Destinations during the initial phase include Yangon, Nyaung\r\nU, Mandalay, Heho, and Myeik. With the support of the valued customers and\r\ndedicated employees, as of today the airline has expanded its operation to Nay\r\nPyi Taw, Kalay, Myitkyina, Lashio, Tachileik, Kyaing Tong, Dawei, Kaw Thaung,\r\nThandwe and Sittwe. AIR KBZ aims to have more than 20 destinations in the near\r\nfuture, covering all the commercial centers of Myanmar.</span><o:p></o:p></p><br><p></p>', 'a:10:{i:0;s:1:\"2\";i:1;s:1:\"3\";i:2;s:1:\"4\";i:3;s:1:\"5\";i:4;s:1:\"6\";i:5;s:1:\"9\";i:6;s:2:\"11\";i:7;s:2:\"12\";i:8;s:2:\"15\";i:9;s:2:\"23\";}', '2018-07-31 17:30:00', '2019-01-31 12:58:59'),
(2, 'Air Mandalay', 'air-mandalay', '6T', 'air-mandalay.png', 'a:6:{i:0;s:19:\"5c52960e332c5_1.jpg\";i:1;s:19:\"5c52960e33669_2.jpg\";i:2;s:19:\"5c52960e3384e_3.jpg\";i:3;s:19:\"5c52960e33a3f_4.jpg\";i:4;s:19:\"5c52960e33c8f_5.jpg\";i:5;s:19:\"5c52960e33ea7_6.jpg\";}', '<p></p><p class=\"MsoNormal\"><span style=\"font-family:\" calisto=\"\" mt\",\"serif\";mso-bidi-font-family:=\"\" \"times=\"\" new=\"\" roman\";color:black;background:white\"=\"\">Air Mandalay Limited is a\r\nprivate joint venture company that was incorporated on 6 October 1994 to\r\noperate as Myanmar’s first joint venture airline and support the country’s\r\nbusiness and tourism industry.</span><span style=\"font-family:\" calisto=\"\" mt\",\"serif\";=\"\" mso-bidi-font-family:\"times=\"\" new=\"\" roman\";color:black\"=\"\"><br style=\"font-variant-ligatures: normal;\r\nfont-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\">\r\n<br style=\"font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;\r\nwidows: 2;-webkit-text-stroke-width: 0px;text-decoration-style: initial;\r\ntext-decoration-color: initial;word-spacing:0px\">\r\n<span style=\"background:white\"><span style=\"font-variant-ligatures: normal;\r\nfont-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\">With its base and head office in Yangon, as well as additional offices\r\nacross Myanmar, Air Mandalay has established itself as a domestic carrier,\r\noperating to international standards and serving Myanmar’s domestic\r\ndestinations. The airline also offers air charter services to destinations -\r\nboth within the country and in the region.</span></span><br style=\"font-variant-ligatures: normal;\r\nfont-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\">\r\n<br style=\"font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;\r\nwidows: 2;-webkit-text-stroke-width: 0px;text-decoration-style: initial;\r\ntext-decoration-color: initial;word-spacing:0px\">\r\n<span style=\"background:white\"><span style=\"font-variant-ligatures: normal;\r\nfont-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\">In April 2015, Air Mandalay introduced jet service with Embraer 145\r\naircraft along its entire route structure. Due to the growth of tourism and\r\neconomic development in Myanmar, air transportation has become an important\r\ncontributor to the country’s economic growth and its infrastructure\r\ndevelopment. Air Mandalay has positioned itself to support the increasing\r\nnumber of foreign visitors and therefore play a vital role in the expansion of\r\nMyanmar’s air transport infrastructure.</span></span><br style=\"font-variant-ligatures: normal;\r\nfont-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\">\r\n<br style=\"font-variant-ligatures: normal;font-variant-caps: normal;orphans: 2;\r\nwidows: 2;-webkit-text-stroke-width: 0px;text-decoration-style: initial;\r\ntext-decoration-color: initial;word-spacing:0px\">\r\n<span style=\"background:white\"><span style=\"font-variant-ligatures: normal;\r\nfont-variant-caps: normal;orphans: 2;widows: 2;-webkit-text-stroke-width: 0px;\r\ntext-decoration-style: initial;text-decoration-color: initial;word-spacing:\r\n0px\">Our aircraft are maintained and operated to international aviation\r\nstandards to ensure operational safety both in the air and on the ground.</span></span></span><span style=\"font-family:\" calisto=\"\" mt\",\"serif\";mso-bidi-font-family:\"times=\"\" new=\"\" roman\"\"=\"\"><o:p></o:p></span></p><br><p></p>', 'a:2:{i:0;s:1:\"1\";i:1;s:2:\"20\";}', '2018-07-31 17:30:00', '2019-01-31 12:30:38'),
(3, 'Asian Wings Airways', 'asian-wings-airways', 'YJ', 'asian-wings-airways.png', 'a:5:{i:0;s:30:\"5b92043e425d4_asianwings-0.jpg\";i:1;s:30:\"5b92043e425d4_asianwings-1.jpg\";i:2;s:30:\"5b92043e425d4_asianwings-2.jpg\";i:3;s:30:\"5b92043e425d4_asianwings-3.jpg\";i:4;s:30:\"5b92043e425d4_asianwings-4.jpg\";}', '<div>Asian Wings Airways was successfully inaugurated on 27 January 2011.</div>They are proud to be a private commercial airline based in Yangon International Airport, Yangon, Myanmar. With over three years of business operations, they have learnt professionalism and the know-hows of operating our airline business in a customer-first sense. they are proud to be catering to travellers around the world with our unique flight services integrated with the euphoria of Myanmar.<br><br><div>Currently being a domestic airline, Asian Wings offers regular flights to all major tourist destinations in Myanmar, such as: Yangon, Mandalay, Nyaung U (Bagan), Heho, Tachileik, Lashio, Monywa, Homalin, Naypyitaw, Myitkyina, Bhamo and Putao. We are happy that we are also providing our airline services to Chiang Mai as our first regional destination. In the very near future, Asian Wings Airways will extend its wings to regional destinations and thrive to become a reliable airline of Myanmar.</div><div><hr></div><div><h3>Vision</h3>To become an airline distinctively recognized and well-known for its warm and generous hospitality with competency.</div><div><hr><h3>Mission</h3>To furnish an air transport service that categorizes among the best in terms of Safety, Reliability and Comfort.</div><div><hr><h3>Core Value</h3>To uphold the highest safety standards.<br>To satisfy our customers by unique hospitality.<br>To improve the quality of our operational performances and services.</div><div><hr><h3>Goals</h3>To Achieve regional areas standards in services and operational performance.<br>To be the Airline of choice in Myanmar.<br>To carry out a business model that will attain constant level of profitability.</div><div><hr></div><div>Now Update</div><div><br></div><div>Now, Asian wings airline is currently suspension all the flight sectors. </div>', 'a:2:{i:0;s:1:\"2\";i:1;s:1:\"3\";}', '2018-07-31 17:30:00', '2019-02-04 14:34:15'),
