INSERT INTO `destinations` (`id`, `name`, `code`, `slug`, `description`, `airport_link`, `img`, `created_at`, `updated_at`) VALUES
(1, 'Yangon', 'RGN', 'yangon', '<div style=\"text-align: justify;\">&nbsp;Yangon is the largest city of Myanmar (Burma) or also commercial capital. The city that is also known as Rangoon was the capital of the country until 2005, when a completely new city called Naypyidaw was built and made the new capital. Yangon has a large number of things to do and landmarks. Yangon has an international airport and an entry point of tourists. Founded by King Alaungphaya on the site of a small settlement called Dagon when he conquered Lower Myanmar in 1755. Towering almost 100 metres above the green city-scope of Yangon, the luminous Shwedagon Pagoda is the landmark visible from miles around. One of the wonders of the world, the Shwedagon is believed to have been built more than 2500 years ago. Other highlights are the colossal Reclining Buddha of Chauk Htatt Kyee Pagoda, Kaba Aye (World Peace Pagoda) and the Great Cave, Botahtaung Pagoda, Sule Pagoda with unique architectural features, the Buddha images of Mailamu Pagoda, National Museum, Bogyoke Aung San Park and Kandawgyi(Royal Lake), the famous shopping centre Bogyoke Market, Myanmar Plaza and Junction City, the Zoological Garden and the Waterboom. Yangon night life can be experienced around City Central Plazas where restaurants, music pubs and Karaoke lounges are located. In Yangon River, River cruises are operated for sunset and dinner. Yangon is the main sector of Air KBZ, Golden Myanmar Airlines, Mann Yandanar Pon Airlines, Yangon Airways, FMI, Myanmar National Airlines and Asian Wings to their experience destinations.<br></div>', 'https://www.google.com/maps/place/Yangon+New+Domestic+Airport/@16.9014904,96.1323328,17z/data=!4m8!1m2!2m1!1sYangon+Domestic+Airport,+Yangon!3m4!1s0x0:0xa676302df88979ff!8m2!3d16.8987813!4d96.132366', 'a:5:{i:0;s:23:\"5aa9fb098a490_boats.jpg\";i:1;s:30:\"5aa9fb098e180_yangon-1 (1).png\";i:2;s:30:\"5aa9fb098e180_yangon-1 (2).png\";i:3;s:30:\"5aa9fb098e180_yangon-1 (3).png\";i:4;s:30:\"5aa9fb098e180_yangon-1 (4).png\";}', '2018-08-22 17:30:00', '2019-01-14 11:32:59'),
(2, 'Mandalay', 'MDL', 'mandalay', 'Founded in 1857, the last capital of the Burmese kingdom of an era gone by, today ranks as the second major city of Myanmar, is the cultural centre and seat of Buddhism, rich in monuments, pagodas and palaces with a flourishing handicraft industry. In this holy city, reputedly prophesized and built by the Buddha Gautama is the most famous pagoda, the Mahamuni followed by the Kuthodaw padoda which holds the 729 stone tabloids of the Tipitaka, and the Shwenandaw temple, wherein is preserved the unique Burmese art with magnificient Jataka scenes engraved on panels of teakwood. A variety of other attractions are puppet shows, traditional dances and visits to the local handicraft centre where bamboo paper and gold leaves are made. It is also a centre for silk and cotton weaving, marble stone carving, bronze and silver crafts and tapestry making.<br><br>', 'https://www.google.com/maps/place/Mandalay+International+Airport/@21.7056493,95.9686426,17z/data=!4m12!1m6!3m5!1s0x30cba6d622534339:0x85d810fad8b4df08!2sMandalay+International+Airport!8m2!3d21.7056493!4d95.9708313!3m4!1s0x30cba6d622534339:0x85d810fad8b4df08!8m2!3d21.7056493!4d95.9708313', 'a:5:{i:0;s:27:\"5c064ebfd119f_mandalay0.jpg\";i:1;s:27:\"5c064ebfd8b80_mandalay1.jpg\";i:2;s:27:\"5c064ebfd8b80_mandalay2.jpg\";i:3;s:27:\"5c064ebfd8b80_mandalay3.jpg\";i:4;s:27:\"5c064ebfd8b80_mandalay4.jpg\";}', '2018-08-22 17:30:00', '2019-01-14 11:32:15'),
(3, 'Nyaung Oo, Bagan', 'NYU', 'nyaung-oo-bagan', '<p>This glittering ancient capital with some 5000 pagodas was founded in 849, whose splendour climaxed during the reign of the first Burmese King Anawrahta in 1057, with over 2000 buildings in an area of 40 Sq Km, making Bagan one of the richest archaeological sites in Asia today. rarefied atmosphere of a thousand golden white and red brick domes, the Shwe Zigon Pagoda, the Sulamani and Ananda temples lay prominently preserving Buddha\'s relic\'s together with art and culture of ancient times, culminating in a panoramic view from the terrace of the Mingalazedi pagoda at sunset. It is also a good place for shopping unique pieces of art. Experience of horse drawn carriage ride in Bagan is unforgettable. It is memorable for its tranquility and its mystical significance lying close to Mt.Popa, an important place of Nat worship.<br><br></p>', 'https://www.google.com/maps/place/Nyaung+U+Airport/@21.1755241,94.926511,17z/data=!3m1!4b1!4m5!3m4!1s0x30b5faf73137c9a7:0x250de82300cac971!8m2!3d21.1755241!4d94.9286997', 'a:4:{i:0;s:24:\"5c245b5cbd397_bagan0.png\";i:1;s:24:\"5c245b5cc48c7_bagan1.png\";i:2;s:24:\"5c245b5cc4caf_bagan2.png\";i:3;s:24:\"5c245b5cc96e7_bagan3.png\";}', '2018-08-22 17:30:00', '2019-01-14 11:39:40'),
(4, 'Heho', 'HEH', 'heho', '<p>Heho is the air gateway of Southern Shan State. It is the main destination to take a journey around Inle Lake, Taung Gyi and Kalaw. <br></p>', 'https://www.google.com/maps/place/Heho+Airport/@20.7435735,96.7913858,17z/data=!3m1!4b1!4m5!3m4!1s0x30ce97760a513d7d:0x435ac983508a5b9d!8m2!3d20.7435735!4d96.7935745', 'a:5:{i:0;s:23:\"5c246115e3cc7_heho0.png\";i:1;s:23:\"5c246115e40af_heho1.png\";i:2;s:23:\"5c246115e4497_heho2.png\";i:3;s:23:\"5c246115e4497_heho3.png\";i:4;s:23:\"5c246115e487f_heho4.png\";}', '2018-08-22 17:30:00', '2019-01-18 14:45:23'),
(5, 'Thandwe', 'SNW', 'thandwe', '<p>Thandwe is one of the cities of Rakhine State. Swaying palms and coconut trees shaded white long unspoiled bach stretching along the coastline of the Bengal Sea where there are no temples, but just the sound of the waves on the beaches to relax and enjoy the sun and the sea food with a splendid suntan guaranteed. Of the four beach resorts most accessible to Myanmar visitors, Ngapali Beach is the prettiest.</p>', 'https://www.google.com/maps/place/Thandwe+Airport/@18.4578955,94.2966427,17z/data=!3m1!4b1!4m5!3m4!1s0x30b91944a799414b:0x61142f6b89e3a563!8m2!3d18.4578955!4d94.2988314', 'a:6:{i:0;s:26:\"5c24636d1d4ff_thandwe0.png\";i:1;s:26:\"5c24636d1d8e7_thandwe1.png\";i:2;s:26:\"5c24636d1dccf_thandwe2.png\";i:3;s:26:\"5c24636d1e0b7_thandwe3.png\";i:4;s:26:\"5c24636d1e49f_thandwe4.png\";i:5;s:26:\"5c24636d1e887_thandwe5.png\";}', '2018-08-22 17:30:00', '2019-01-14 11:42:09'),
