(7, 'Ann', 'VBA', 'ann', '<p>Ann is a town in Rakhine State, Myanmar (Burma). It has a population of 119,714 and is served by Ann Airport. <br></p>', 'https://www.google.com/maps/place/Ann+Airport/@19.7698566,94.0245744,17z/data=!3m1!4b1!4m5!3m4!1s0x30b743ace8389571:0x9375987aeaec2a35!8m2!3d19.7698566!4d94.0267631', 'a:6:{i:0;s:33:\"5c3c25eb98b0f_ann6 - Copy (2).jpg\";i:1;s:33:\"5c3c25eb98ff3_ann6 - Copy (3).jpg\";i:2;s:33:\"5c3c25eb993e9_ann6 - Copy (4).jpg\";i:3;s:33:\"5c3c25eb997e0_ann6 - Copy (5).jpg\";i:4;s:29:\"5c3c25eb99be4_ann6 - Copy.jpg\";i:5;s:22:\"5c3c25eb9a03e_ann6.jpg\";}', '2018-08-22 17:30:00', '2019-01-14 12:02:19'),
