(9, 'Dawei', 'TVY', 'dawei', '<p>Dawei is a city in south-eastern Myanmar and is the capital of the Tanintharyi Region, formerly known as the Tenasserim Division, about 614.3 km (381.7 mi) south of Yangon on the northern bank of the Dawei River. Population (2004 estimate), 139,900. It is at 14.09°N 98.20°E. Dawei is a port at the head of the Dawei River estuary, 30 km (18.6 mi). from the Andaman Sea. As a result, the city is prone to flooding during the monsoon season. \"Dawei\" is also the name of one of Myanmar\'s 135 ethnic minorities. Ref:wikipedia<br></p>', 'https://www.google.com/maps/place/Dawei+Airport/@14.078112,98.1953137,13.75z/data=!4m5!3m4!1s0x30e50bcb5841ba19:0xed851e15611a16a1!8m2!3d14.100159!4d98.202796', 'a:7:{i:0;s:24:\"5c3c34088c063_dawei0.jpg\";i:1;s:24:\"5c3c34088c3ff_dawei1.jpg\";i:2;s:24:\"5c3c34088c767_dawei3.jpg\";i:3;s:24:\"5c3c34088ca8c_dawei4.jpg\";i:4;s:24:\"5c3c34088cde1_dawei5.jpg\";i:5;s:24:\"5c3c34088d171_dawei6.jpg\";i:6;s:24:\"5c3c34088d50c_dawei7.jpg\";}', '2018-08-22 17:30:00', '2019-01-14 13:02:32'),
(10, 'Homalin', 'HOX', 'homalin', '<p>Homali is the airport gateway and small town of the north-west Myanmar (Burma). It is near the Chindwin River.<br></p>', 'https://www.google.com/maps/place/Homalin+Airport/@24.8841785,94.9186247,17z/data=!3m1!4b1!4m5!3m4!1s0x37482dc1eab1ae4d:0x4545076a3e48a8c8!8m2!3d24.8841785!4d94.9208134', 'a:5:{i:0;s:23:\"5aa9fb098a490_boats.jpg\";i:1;s:30:\"5aa9fb098e180_yangon-1 (1).png\";i:2;s:30:\"5aa9fb098e180_yangon-1 (2).png\";i:3;s:30:\"5aa9fb098e180_yangon-1 (3).png\";i:4;s:30:\"5aa9fb098e180_yangon-1 (4).png\";}', '2018-08-22 17:30:00', '2019-01-18 14:49:47'),
