(16, 'Lashio', 'LSH', 'lashio', '<div>Lashio is the largest town in northern Shan State, Myanmar, about 200 kilometres (120 mi) north-east of Mandalay. It is situated on a low mountain spur overlooking the valley of the Yaw River.Loi Leng, the highest mountain of the Shan Hills, is located 45 km (28 mi) to the south-east of Lashio.Lashio is the administrative center of Lashio Township and Lashio District; before April 2010, it was also the administrative center of Shan State (North). The population grew from approximately 5000 in 1960 to 88,590 in 1983. It is currently estimated at approximately 130,000.The population is made up of mostly Shan, Chinese and Burmans. <br></div><div><br></div><div><span style=\"font-weight: bold;\">Ref: Wikipedia</span><br></div>', 'https://www.google.com/maps/place/Yangon+New+Domestic+Airport/@16.9014904,96.1323328,17z/data=!4m8!1m2!2m1!1sYangon+Domestic+Airport,+Yangon!3m4!1s0x0:0xa676302df88979ff!8m2!3d16.8987813!4d96.132366', 'a:8:{i:0;s:19:\"5c57c458d4cd5_0.jpg\";i:1;s:19:\"5c57c458d5234_1.jpg\";i:2;s:19:\"5c57c458d5497_2.jpg\";i:3;s:19:\"5c57c458d6ef4_3.jpg\";i:4;s:19:\"5c57c458d7411_4.jpg\";i:5;s:19:\"5c57c458d7723_5.jpg\";i:6;s:19:\"5c57c458d7923_6.jpg\";i:7;s:19:\"5c57c458d7cc8_7.jpg\";}', '2018-08-22 17:30:00', '2019-02-04 10:50:58'),
