(18, 'Mawlamyine', 'MNU', 'mawlamyine', '<p><span style=\"color: rgb(51, 0, 0);\">Mawlamyine is&nbsp; the fourth largest city in Myanmar situated 180 kilometers east of the nation\'s capital across the Gulf of Mottama at the mouth of the Thanlwin river. It is the capital of Mon State with a population of about 400,000 people. Formerly known as Moulmein, it was once a major port and the administrative capital of British Lower Burma. The town\'s signature landmark is Kyaikthanlan pagoda built in 875 AD and&nbsp; thought to be the site from where Rudyard Kipling wrote his famous poem, \'The Road to Mandalay\'.The Thanlwin bridge, the longest road and rail bridge in Myanmar is the most prominent landmark in the area. It stretches a distance of 11,000 feet over the Thanlwin river connecting the country\'s south eastern region with Yangon. Mawlamyine is generally considered to be off the main tourist trail for most travellers to Myanmar but the town does have a charm of its own with its rich history, buildings with colonial style architecture, World War II era wooden buses, and its close proximity to the infamous Siam-Burma \"death railway\", making it a fascinating place to visit</span></p><p><span style=\"color: rgb(51, 0, 0);\">Ref: mawlamyine.com</span><br></p>', 'https://www.google.com/maps/place/Mawlamyine+Airport/@16.4414914,97.655449,17z/data=!3m1!4b1!4m5!3m4!1s0x30c2a906dbd6cd75:0x1b6ee358518ce986!8m2!3d16.4414914!4d97.6576377', 'a:8:{i:0;s:29:\"5c47ecec38cae_mawlamyine0.jpg\";i:1;s:29:\"5c47ecec390be_mawlamyine1.jpg\";i:2;s:29:\"5c47ecec393e5_mawlamyine2.jpg\";i:3;s:29:\"5c47ecec39630_mawlamyine3.jpg\";i:4;s:29:\"5c47ecec398f1_mawlamyine4.jpg\";i:5;s:29:\"5c47ecec39dad_mawlamyine5.jpg\";i:6;s:29:\"5c47ecec3a103_mawlamyine6.jpg\";i:7;s:29:\"5c47ecec3a465_mawlamyine8.jpg\";}', '2018-08-22 17:30:00', '2019-01-23 10:33:09'),
(19, 'Myeik', 'MGZ', 'myeik', '<p>Myeik sits on a peninsula that juts into the Andaman Sea. With a location roughly halfway between the Middle East and China, not to mention the safe harbour offered by the peninsula and facing islands, Myeik became an important international port over 500 years ago.The legacy of that long trading history is a multicultural population, with the descendants of Chinese and Indian Muslim traders joined by Bamar, Mon and Moken (sea gypsies) people. Myeik\'s intriguing past is also reflected in its buildings, with grand Sino-Portuguese houses jostling with mosques, churches, traditional wooden homes and colonial-era mansions to create a kaleidoscope of architectural styles. Myeik is still a bustling port today. It\'s home to a large fishing fleet, as well as being the centre of Myanmar\'s pearl industry, and, along with the port of Kawthoung, is the gateway to the 800-odd islands of the Myeik Archipelago. <br></p><p>Ref: lonelyplanet<br></p>', 'https://www.google.com/maps/place/Myeik+airport/@12.4476201,98.6168918,17z/data=!3m1!4b1!4m5!3m4!1s0x30fbb0525bfca86b:0x84eefb0e134c099d!8m2!3d12.4476201!4d98.6190805', 'a:6:{i:0;s:24:\"5c47f2f3e63f8_myeik0.jpg\";i:1;s:24:\"5c47f2f3e680d_myeik1.jpg\";i:2;s:24:\"5c47f2f3e6b0e_myeik2.jpg\";i:3;s:24:\"5c47f2f3e6de3_myeik4.jpg\";i:4;s:25:\"5c47f2f3e70b3_myeik11.jpg\";i:5;s:25:\"5c47f2f3e7330_myeik12.jpg\";}', '2018-08-22 17:30:00', '2019-01-23 10:52:03'),
