(21, 'Putao', 'PBU', 'putao', '<div><span style=\"color: rgb(51, 0, 0);\">Putao is the northernmost town of Kachin State, Myanmar. It is the principal town in Putao Township. It can only be reached by road during summer (for locals), but is accessible year round by air if there are sufficient tourist groups to justify a plane. The area around Putao is famous for the variety of endemic birds and rare orchids, which grow naturally. Many orchid lovers are especially attracted by the so-called \"Black Orchid\" that can be found in the mountains east and west of Putao. Hkakabo Razi and other snow-capped mountains are visible from Putao. Putao also attracts enthusiasts, hiking to Hkakabo Razi base camp, located close to Tahaundam.</span></div><div><span style=\"color: rgb(51, 0, 0);\"><br></span></div><div><span style=\"color: rgb(51, 0, 0);\">Ref: Wikipedia.org<br></span></div>', 'https://www.google.com/maps/place/Putao+Airport/@27.329495,97.4245004,17z/data=!3m1!4b1!4m5!3m4!1s0x373c9542bfaf94e3:0xeb428b0222a7023e!8m2!3d27.329495!4d97.4266891', 'a:7:{i:0;s:25:\"5c47fa27ec7c5_putato0.jpg\";i:1;s:25:\"5c47fa27ecaac_putato1.jpg\";i:2;s:25:\"5c47fa27ecdd9_putato2.jpg\";i:3;s:25:\"5c47fa27ed0e0_putato3.jpg\";i:4;s:25:\"5c47fa27ed4eb_putato4.jpg\";i:5;s:25:\"5c47fa27ed7fa_putato5.jpg\";i:6;s:25:\"5c47fa27edafc_putato7.jpg\";}', '2018-08-22 17:30:00', '2019-01-23 11:22:47'),
(22, 'Sittway', 'AKY', 'sittway', '<span style=\"color: rgb(51, 0, 0);\">Rakhine State’s capital, Sittwe, sits in an incredible spot where the wide, tidal Kaladan River kisses the big, fat Bay of Bengal. It\'s a historic place, although there\'s little of that past still around or accessible. There are some lively markets, and when the new port is finished an economic boom might liven things up, but for now there\'s little of real interest here. The impact of ongoing sectarian violence in Rakhine State, along with the town\'s generally scrappy vibe, means that most visitors approach the city as little more than a transit point to the ruins at Mrauk U.</span>', 'https://www.google.com/maps/place/%E1%80%85%E1%80%85%E1%80%BA%E1%80%90%E1%80%BD%E1%80%B1%E1%80%9C%E1%80%B1%E1%80%86%E1%80%AD%E1%80%95%E1%80%BA/@20.1348371,92.8709503,17z/data=!3m1!4b1!4m5!3m4!1s0x30b04f438a67540d:0xab2b313889400a29!8m2!3d20.1348371!4d92.873139', 'a:6:{i:0;s:25:\"5c47f6767c100_sittwe1.jpg\";i:1;s:25:\"5c47f6767c3d8_sittwe3.jpg\";i:2;s:25:\"5c47f6767c729_sittwe4.jpg\";i:3;s:25:\"5c47f6767ca5c_sittwe5.jpg\";i:4;s:26:\"5c47f6767cc2a_sittwe10.jpg\";i:5;s:26:\"5c47f6767cf14_sittwe12.jpg\";}', '2018-08-22 17:30:00', '2019-01-23 11:07:02'),
