(1, 'things-to-do', 'a:5:{i:0;s:23:\"5c2c62dbcd565_heho0.png\";i:1;s:23:\"5c2c62dbd1f9d_heho1.png\";i:2;s:23:\"5c2c62dbd1f9d_heho2.png\";i:3;s:23:\"5c2c62dbd2385_heho3.png\";i:4;s:23:\"5c2c62dbd276d_heho4.png\";}', 'Things to do', 'things to do myanmar,myanmar flights', 'Airmyanmar.com - Myanmar Flight Center - Things to do around myanmar.', '<div><h4>Best Trip Routes</h4></div><div><span style=\"text-decoration: underline;\"><span style=\"font-weight: bold;\">Yangon - Mandalay - Bagan - Mindat - Mt.Victoria</span></span></div><div><span style=\"text-decoration: underline;\"><span style=\"font-weight: bold;\">Yangon - Kyike Hto - Hpa An - Mawlamyine - Wae Ka Wah</span></span></div><div><span style=\"text-decoration: underline;\"><span style=\"font-weight: bold;\">Yangon - Ngapali - Bagan - Kalaw - Yangon</span></span></div><div><span style=\"text-decoration: underline;\"><span style=\"font-weight: bold;\">Yangon - Loikaw - Inle - Mandalay - Yangon</span></span></div><div><br></div><div>You could buy flight tickets from our flight center, Air Myanmar<br></div>', 1, '2018-12-28 03:54:57', '2019-01-18 15:15:25'),
(2, 'terms-conditions', NULL, 'Terms & Conditions', 'myanmar flight center terms,airmyanmar.com terms & conditions', 'Airmyanmar.com - Myanmar Flight Center - Terms & Conditions', '<dl class=\"list-terms\" style=\"text-align: justify;\"><p><span style=\"color: rgb(51, 0, 51);\">General information</span></p><p><span style=\"color: rgb(51, 0, 51);\">Welcome to our Privacy Policy page! When you use our web site \r\nservices, you trust us with your information. This Privacy Policy is \r\nmeant to help you understand what data we collect, why we collect it, \r\nand what we do with it. When you share information with us, we can make \r\nour services even better for you. For instance, we can show you more \r\nrelevant search results and ads, help you connect with people or to make\r\n sharing with others quicker and easier. As you use our services, we \r\nwant you to be clear how we are using information and the ways in which \r\nyou can protect your privacy. This is important; we hope you will take \r\ntime to read it carefully. Remember, you can find controls to manage \r\nyour information and protect your privacy and security. We\'ve tried to \r\nkeep it as simple as possible.</span></p><p><span style=\"color: rgb(51, 0, 51);\">Right to access, correct and delete data and to object to data processing</span></p><p><span style=\"color: rgb(51, 0, 51);\">Our customers have the right to access, correct and delete personal \r\ndata relating to them, and to object to the processing of such data, by \r\naddressing a written request, at any time. The Company makes every \r\neffort to put in place suitable precautions to safeguard the security \r\nand privacy of personal data, and to prevent it from being altered, \r\ncorrupted, destroyed or accessed by unauthorized third parties. However,\r\n the Company does not control each and every risk related to the use of \r\nthe Internet, and therefore warns the Site users of the potential risks \r\ninvolved in the functioning and use of the Internet. The Site may \r\ninclude links to other web sites or other internet sources. As the \r\nCompany cannot control these web sites and external sources, the Company\r\n cannot be held responsible for the provision or display of these web \r\nsites and external sources, and may not be held liable for the content, \r\nadvertising, products, services or any other material available on or \r\nfrom these web sites or external sources.</span></p><p><span style=\"color: rgb(51, 0, 51);\">Management of personal data</span></p><p><span style=\"color: rgb(51, 0, 51);\">You can view or edit your personal data online for many of our \r\nservices. You can also make choices about our collection and use of your\r\n data. How you can access or control your personal data will depend on \r\nwhich services you use. You can choose whether you wish to receive \r\npromotional communications from our web site by email, SMS, physical \r\nmail, and telephone. If you receive promotional email or SMS messages \r\nfrom us and would like to opt out, you can do so by following the \r\ndirections in that message. You can also make choices about the receipt \r\nof promotional email, telephone calls, and postal mail by visiting and \r\nsigning into Company Promotional Communications Manager, which allows \r\nyou to update contact information, manage contact preferences, opt out \r\nof email subscriptions, and choose whether to share your contact \r\ninformation with our partners. These choices do not apply to mandatory \r\nservice communications that are part of certain web site services.</span></p><p><span style=\"color: rgb(51, 0, 51);\">Information We Collect</span></p><p><span style=\"color: rgb(51, 0, 51);\">Our store collects data to operate effectively and provide you the \r\nbest experiences with our services. You provide some of this data \r\ndirectly, such as when you create a personal account. We get some of it \r\nby recording how you interact with our services by, for example, using \r\ntechnologies like cookies, and receiving error reports or usage data \r\nfrom software running on your device. We also obtain data from third \r\nparties (including other companies). For example, we supplement the data\r\n we collect by purchasing demographic data from other companies. We also\r\n use services from other companies to help us determine a location based\r\n on your IP address in order to customize certain services to your \r\nlocation. The data we collect depends on the services and features you \r\nuse.</span></p><p><span style=\"color: rgb(51, 0, 51);\">How We Use Your Information</span></p><p><span style=\"color: rgb(51, 0, 51);\">Our web site uses the data we collect for three basic purposes: to \r\noperate our business and provide (including improving and personalizing)\r\n the services we offer, to send communications, including promotional \r\ncommunications, and to display advertising. In carrying out these \r\npurposes, we combine data we collect through the various web site \r\nservices you use to give you a more seamless, consistent and \r\npersonalized experience. However, to enhance privacy, we have built in \r\ntechnological and procedural safeguards designed to prevent certain data\r\n combinations. For example, we store data we collect from you when you \r\nare unauthenticated (not signed in) separately from any account \r\ninformation that directly identifies you, such as your name, email \r\naddress or phone number.</span></p><p><span style=\"color: rgb(51, 0, 51);\">Sharing Your Information</span></p><p><span style=\"color: rgb(51, 0, 51);\">We share your personal data with your consent or as necessary to \r\ncomplete any transaction or provide any service you have requested or \r\nauthorized. For example, we share your content with third parties when \r\nyou tell us to do so. When you provide payment data to make a purchase, \r\nwe will share payment data with banks and other entities that process \r\npayment transactions or provide other financial services, and for fraud \r\nprevention and credit risk reduction. In addition, we share personal \r\ndata among our controlled affiliates and subsidiaries. We also share \r\npersonal data with vendors or agents working on our behalf for the \r\npurposes described in this statement. For example, companies we\'ve hired\r\n to provide customer service support or assist in protecting and \r\nsecuring our systems and services may need access to personal data in \r\norder to provide those functions. In such cases, these companies must \r\nabide by our data privacy and security requirements and are not allowed \r\nto use personal data they receive from us for any other purpose. We may \r\nalso disclose personal data as part of a corporate transaction such as a\r\n merger or sale of assets.</span></p></dl>', 1, '2018-12-28 23:12:17', '2019-01-01 22:22:00'),
(3, 'coming-soon', NULL, 'Coming Soon', 'myanmar flight center,airmyanmar.com', 'Coming Soon Page', '<span style=\"font-weight: bold;\">Page is coming soon<br></span>', 1, '2019-01-06 23:32:46', '2019-01-06 23:32:46'),
(4, 'how-to-book', NULL, 'How to Book', 'how to book myanmar domestic flights,how to book flights in myanmar,how pay for myanmar flight bookings', 'Myanmar Flights Centre - Airmyanmar.com, How to book myanmar domestic flights or pay for booking.', '<ol><li>Firstly you would have to fill the departure airport city, the returned airport city, number of passengers and travel dates. Then, you could choose your desired flight by filtering or checking fares or airlines. After, you could select and book. In the end of booking process through our website, your booking stage would be been in processing list and an automatic email from our booking system would be received. After action of sale team, your booking status would change to another status.</li><li>Our booking status possess the following status</li><li><span style=\"font-weight: bold;\">processing list</span> (It means pending or no action from sale team)</li><li><span style=\"font-weight: bold;\">awaiting payment</span> (It means requesting payment for your booking)</li><li><span style=\"font-weight: bold;\">completed</span> (It means confirmation stage of your booking after your successful full payment. Most of this stage could be refunded. You could download E-confirmation Online through our website)</li><li><span style=\"font-weight: bold;\">final completed </span>(It means in which you could download E-tickets for your trip. Your booking was final complete)</li><li><span style=\"font-weight: bold;\">cancel as fully booked </span>(It means which the flights you booked is no seat available in domestic airline reservation system<span style=\"font-weight: bold;\">)</span></li><li><span style=\"font-weight: bold;\">cancelled </span>(It means that your booking may be duplicate booking or booking you requested to cancel or booking sale team dropped to this list due to booking deadline and closet to travel date)<br></li></ol>', 1, '2019-01-31 11:02:57', '2019-01-31 11:19:22');
