(2, 'Myanmar Flight Center,Air Myanmar,airmyanmar.com,yangon airways', 'Myanmar/Burma Flight Center - Air Myanmar - About Yangon Airways', 'about-yangon-airway', 'About Yangon Airway', 'Air Myanmar Team', '<div style=\"text-align: justify;\">Yangon Airways was established in October 1996, as a domestic airline in\r\n a joint venture between Myanma Airways, the state-owned national \r\nairline and Krong-Sombat Co., of Thailand. In October 1997, \r\nMHE-Mayflower Co., acquired Kong- Sombat\'s shares in Yangon Airways and \r\nthe remaining shares in 2005. Since then the airline has evolved into a \r\nprincipal domestic airline operating scheduled and charter services from\r\n yangon to 15 prime commercial and tourist destinations in Myanmar.</div>', '5c35c5f04c94a-4.jpg', 1, '2019-01-09 03:29:12', '2019-01-09 04:12:41');
